// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

//REVERT HANDLER
contract RevertStatement {
    function checkOverFlow(uint256 _num1, uint256 _num2) public view returns (string memory) {
        try this.safeAdd(_num1, _num2) {
            return "No overflow";
        } catch {
            return "Overflow Exist";
        }
    }

    function safeAdd(uint256 _num1, uint256 _num2) public pure returns (uint256) {
        uint256 sum = _num1 + _num2;
        require(sum >= _num1, "Overflow");
        return sum;
    }
}

